export default function Calculator() {
  return (
    <div>
      <h2>Choose a Calculator</h2>
      <div className="container">
        <div className="image-grid">
          <img src="/calculator/craiyon_173320_A_tree_full_of_money_and_crypto_currency__and_in_the_background_a_wall_full_of_many_blue.png" alt="SIP Growth Calculator" />
          <div className="middle">
            <Link to="/Calculator/Sip">
              <button>SIP Growth Calculator</button>
            </Link>
          </div>
        </div>
        <div className="image-grid">
          <img src="/calculator/craiyon_173348_Bribe_Money_inside_a_paper_bag_blue.png" alt="LUMPSUM Growth Calculator" />
          <div className="middle">
            <Link to="/Calculator/lumpsum">
              <button>LUMPSUM Growth Calculator</button>
            </Link>
          </div>
        </div>
        <div className="image-grid">
          <img src="/calculator/craiyon_173410_complex_machine_that_prints_money__spitting_out_a_ton_of_100_dollar_bills__styled_in_pink.png" alt="SIP TOP UP Growth Calculator" />
          <div className="middle">
            <Link to="/Calculator/topup">
              <button>SIP TOP UP Growth Calculator</button>
            </Link>
          </div>
        </div>
        <div className="image-grid">
          <img src="/calculator/craiyon_173453_Visualize_business_growth_through_a_series_of_ascending_steps_with_charts_and_coins__multicolor.png" alt="Asset Future Value Calculator" />
          <div className="middle">
            <Link to="/Calculator/asset">
              <button>Asset Future Value Calculator</button>
            </Link>
          </div>
        </div>
        <div className="image-grid">
          <img src="/calculator/craiyon_173320_A_tree_full_of_money_and_crypto_currency__and_in_the_background_a_wall_full_of_many_blue.png" alt="Time Duration Calculator - One Time Investment" />
          <div className="middle">
            <Link to="/Calculator/onetime">
              <button>Time Duration Calculator - One Time Investment</button>
            </Link>
          </div>
        </div>
        <div className="image-grid">
          <img src="/calculator/final_craiyon_173436_money_walking-removebg-preview.png" alt="Time Duration Calculator - Regular Investment" />
          <div className="middle">
            <Link to="/Calculator/regular">
              <button>Time Duration Calculator - Regular Investment</button>
            </Link>
          </div>
        </div>
      </div>
    </div>  

  );
}
